--城市表
DROP TABLE IF EXISTS t_city;
CREATE TABLE t_city(
       id                   VARCHAR(32)                    PRIMARY KEY             ,           --ID，主键
       name                 VARCHAR(100)                   NOT NULL                ,           --城市名
       detail               VARCHAR(255)                                           ,           --详细城市名
       baidu_code           INTEGER                                                ,           --百度城市代码
       area_code            INTEGER                                                ,           --电话区域代码
       zip_code             INTEGER                                                ,           --邮政编码（省份无编码）
       admin_code           INTEGER                                                ,           --行政区划代码
       parent_id            VARCHAR(32)                                                        --上级ID（外键，自关联）
);


